package server

import (
	"encoding/base64"
)

func GetAssets() map[string][]byte {
	var assets = make(map[string][]byte, 3)

	assets["js/base64js.min.js"], _ = base64.StdEncoding.DecodeString("")

	assets["js/sjcl.min.js"], _ = base64.StdEncoding.DecodeString("")

	assets["view.html"], _ = base64.StdEncoding.DecodeString("")

	return assets
}
